using eCommerceBase.Domain.AggregateModels;
using eCommerceBase.Domain.Constant;
using eCommerceBase.Domain.SeedWork;
using Microsoft.Extensions.Configuration;
using Nest;
using System.Globalization;
using System.Reflection;

namespace eCommerceBase.Persistence.Extensions
{
    public static class SearchEngineRegistration
    {
        public static ElasticClient GetElasticClient(IConfiguration configuration)
        {
            return new ElasticClient(
            new ConnectionSettings(
            new Uri(configuration["ElasticConfiguration:Uri"] ?? "http://host.docker.internal:9200")));
        }
        public static async Task MigrateElasticDbAsync(Assembly[] assemblies, IConfiguration configuration)
        {
            var entityTypes = assemblies
            .SelectMany(assembly => assembly.GetTypes())
            .Where(type => typeof(IElasticEntity).IsAssignableFrom(type) && !type.IsInterface && !type.IsAbstract)
            .ToList();
            var client = GetElasticClient(configuration);
            await Task.WhenAll(entityTypes.Select(async entity =>
            {
                var name = $"{configuration["RegionName"]}-{entity.Name}".ToLower(new CultureInfo("en-US"));
                if (!(await client.Indices.ExistsAsync(name)).Exists)
                {
                    var response = await client.Indices.CreateAsync(name
                    , se => se.Settings(a => a.NumberOfReplicas(3).NumberOfShards(3)));
                }
            }));
            await SeedSearchEngine(client, configuration);
        }
        public static async Task SeedSearchEngine(ElasticClient client, IConfiguration configuration, string tableName="WebsiteInfo")
        {
            var policy = CoreContextSeedExtension.CreatePolicy(3);
            await policy.ExecuteAsync(async () =>
            {
                var indexName = $"{configuration["RegionName"]}-{tableName}".ToLower(new CultureInfo("en-US"));
                var existingDoc = await client.GetAsync<WebsiteInfo>(InitConst.WebSiteInfoId, g => g.Index(indexName));
                if (!existingDoc.Found)
                {
                    var data = new WebsiteInfo("Social media ismi", "", "web sitesi ismi",null);
                    data.AddSocialMediaInfos(new SocialMediaInfo(Guid.NewGuid(),"Facebook", "www.facebook.com", "data:image/png;base64,"));
                    data.AddSocialMediaInfos(new SocialMediaInfo(Guid.NewGuid(),"Twitter", "www.twitter.com", "data:image/png;base64,"));
                    data.AddSocialMediaInfos(new SocialMediaInfo(Guid.NewGuid(),"Youtube", "www.youtube.com", "data:image/png;base64,"));
                    data.AddSocialMediaInfos(new SocialMediaInfo(Guid.NewGuid(), "Instagram", "www.instagram.com", "data:image/png;base64,"));
                    var response = await client.IndexAsync(data, idx => idx.Index(indexName));
                    if (!response.IsValid)
                    {
                        throw new Exception("Failed WebsiteInfo Migration");
                    }
                }
            });
        }
    }
}
